tables.table_schema:
CREATE TABLE women_rights_advocacy (
    organization_id INT PRIMARY KEY,
    organization_name TEXT NOT NULL,
    initiative TEXT,
    impact TEXT
);

CREATE TABLE organizations (
    org_id INT PRIMARY KEY,
    org_name VARCHAR(255) NOT NULL,
    org_type VARCHAR(50) NOT NULL,
    org_location VARCHAR(100) NOT NULL
);

CREATE TABLE initiatives (
    initiative_id INT PRIMARY KEY,
    org_id INT REFERENCES organizations(org_id),
    initiative_name VARCHAR(255) NOT NULL,
    initiative_description TEXT,
    initiative_date DATE
);

CREATE TABLE impact (
    impact_id SERIAL PRIMARY KEY,
    initiative_id INT REFERENCES initiatives(initiative_id),
    impact_type VARCHAR(50) NOT NULL,
    impact_description TEXT
);

CREATE TABLE organizations ( 
    org_id SERIAL PRIMARY KEY, 
    org_name VARCHAR(100) NOT NULL, 
    location VARCHAR(100), 
    founding_year INT 
);

CREATE TABLE impact ( 
    impact_id SERIAL PRIMARY KEY, 
    impact_description TEXT, 
    impact_date DATE, 
    init_id INT REFERENCES initiatives(init_id) 
);

CREATE TABLE organizations (
  org_id INT PRIMARY KEY,
  org_name VARCHAR(255),
  org_mission TEXT,
  org_location VARCHAR(100)
);

CREATE TABLE impact_metrics (
  metric_id INT PRIMARY KEY,
  metric_name VARCHAR(255),
  metric_description TEXT
);
